import "./Brand.css"

export default function Brand(props) {
    return (
        <div className="page-content">
            <div className="brand-content">
                <img src="https://www.svgrepo.com/show/794/male-user.svg" alt="profile-img" className="profile-pic"/>
                <div className="vr"></div>
                <h1>brand placement</h1>
            </div>
        </div>
    )
}
